import Card from '../../components/Card'
import styles from './Equipe.module.css'

const equipe = [
  { titulo: "Arthur", preco: "Barbeiro Sênior", imagem: "/imagens/arthur.jpg" },
  { titulo: "Vitória", preco: "Estilista", imagem: "/imagens/vitoria.jpg" },
  { titulo: "Joicy", preco: "Especialista em Barba", imagem: "/imagens/joicy.jpg" },
  { titulo: "Geovanna", preco: "Colorimetria", imagem: "/imagens/geovanna.jpg" },
]

export default function Equipe() {
  return (
    <section className={styles.equipe}>
      <h1>Nossa Equipe</h1>
      <div className={styles.grid}>
        {equipe.map((m, i) => <Card key={i} {...m} />)}
      </div>
    </section>
  )
}
